import { Hook } from "./Hook"; // Импортируем хук
import { FullServiceCardInfo } from "./components/FullServiceCardInfo/FullServiceCardInfo";
import { ServiceList } from "./components/ServiceList/ServiceList";
import { MainPage } from "./components/MainPage/MainPage";
import { BrowserRouter ,Routes, Route } from 'react-router-dom'; // Импортируем Router и Routes
import { useNavigate } from 'react-router-dom'; // Импортируем useNavigate

import Styles from "./App.module.css";

function App() {
  const hook = Hook();
  const navigate = useNavigate();

  return (
    <BrowserRouter>
      <Routes>
      <Route path="/main" element={<div className={Styles.curtain}>
          <div className={Styles.full_logo} onClick={navigate("/main")}>
            <span className={Styles.logo}>IS-COM</span>
            <span className={Styles.under_logo}>ваш надежный <br />провайдер!</span>
          </div>

          <div className={Styles.right_buttons_container}>
            <button className={Styles.right_buttons} onClick={navigate("/services")}>
              Услуги
            </button>
            <button className={Styles.right_buttons} onClick={() => console.log('Заявки clicked')}>
              Заявки
            </button>
          </div>
        </div>} />
        <Route path="/main" element={<MainPage />} />
        <Route path="/services" element={<ServiceList services={hook.services} />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
